import React from 'react'

const PayOut = () => {
  return (
    <>
    <div className=' mt-[35250px0px] flex flex-col items-center justify-center'>
        <div className='text-2xl font-Poppins font-extrabold'>
            Waiting for the <span className='text-green-600'>"SSL"</span> Certificate
        </div>
    </div>
    </>
  )
}

export default PayOut
